import { FC, ReactElement } from "react"
interface Froms {
    switchFrom: (value:string) => void
}
const LoginFrom:FC<Froms> = ({
    switchFrom
}):ReactElement => {
    return (
        <>Login</>
    )
}
export default LoginFrom
